Sigiriya or Sinhagiri (Lion Rock) is an ancient rock fortress located in the Northern Matale region of Dambulla in the Central Province of Sri Lanka. The name refers to a site of historical and archaeological importance, dominated by a large rock column about 200 meters high. According to the ancient Sri Lankan Culavamsa chronicles, it was chosen as the capital by King Kasyapa (477-495 AD). The king built his palace on this rock and adorned the sides with colorful frescoes. In an area halfway through this rock, the name of a tremendous tremendous Sigiriya is from the structure called Sƒ±haÃÑgiri from the Lion Ski. After the king's death, the capital and the royal palace were abandoned. It was used as a Buddhist monastery until the 14th century. In 1982, Sigiriya was listed as a World Heritage Site by UNESCO. Sigiriya is one of the best preserved examples of ancient city planning.

